import React from 'react'
import "./Box.css"

const Box = (props) => {
    const box_style = props.value === "X" ? "box x" : "box o";
    return (
        <button className={box_style} onClick={props.onClick}>
            {props.value}
        </button>
    )
}

export default Box;
